import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';

export default function Header() {
  return (
    
        <header>
            <div className="topnav mx-auto px-4 max-w-[theme('spacing.container')] flex items-center justify-between h-16 bg-brandPurple90 text-white">
      <Link to="/" className="flex items-center gap-2">
        <img src={logo} alt="QLove Logo" className="h-10" />
        <span className="font-bold text-xl">QLove</span>
      </Link>
      <ul className="flex gap-6">
        <li>
          <Link to="/about" className="hover:text-blue-500">About Us</Link>
        </li>
        <li>
          <Link to="/products" className="hover:text-blue-500">Products</Link>
        </li>
      </ul>
      </div>
    </header>

  );
}
